<node TEXT="&#x41d;&#x435;&#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x435;" ID="ID_1290008209" CREATED="1389015143005" MODIFIED="1389645291911"><richcontent TYPE="NOTE">

