<node TEXT="&#x41b;&#x43e;&#x43a;&#x430;&#x43b;&#x438;&#x437;&#x430;&#x446;&#x438;&#x438;" ID="ID_471985301" CREATED="1389015245838" MODIFIED="1389646195836"><richcontent TYPE="NOTE">

