        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435;, &#x432;&#x43e; &#x432;&#x440;&#x435;&#x43c;&#x44f; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x433;&#x43e; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x43d;&#x44f;&#x44e;&#x442;&#x441;&#x44f; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x438;, &#x432;&#x44b;&#x44f;&#x432;&#x438;&#x432;&#x448;&#x438;&#x435; &#x43e;&#x448;&#x438;&#x431;&#x43a;&#x438; &#x432;&#x43e; &#x432;&#x440;&#x435;&#x43c;&#x44f; &#x43f;&#x43e;&#x441;&#x43b;&#x435;&#x434;&#x43d;&#x435;&#x433;&#x43e; &#x437;&#x430;&#x43f;&#x443;&#x441;&#x43a;&#x430;, &#x434;&#x43b;&#x44f; &#x43f;&#x43e;&#x434;&#x442;&#x432;&#x435;&#x440;&#x436;&#x434;&#x435;&#x43d;&#x438;&#x44f; &#x443;&#x441;&#x43f;&#x435;&#x448;&#x43d;&#x43e;&#x441;&#x442;&#x438; &#x438;&#x441;&#x43f;&#x440;&#x430;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x44d;&#x442;&#x438;&#x445; &#x43e;&#x448;&#x438;&#x431;&#x43e;&#x43a;. (<u>ISTQB</u>)
