<node TEXT="&#x421;&#x43f;&#x435;&#x446;&#x438;&#x430;&#x43b;&#x438;&#x437;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x43d;&#x43e;&#x435; (&#x441;&#x432;&#x43e;&#x431;&#x43e;&#x434;&#x43d;&#x43e;&#x435;)" ID="ID_1047323144" CREATED="1389015472530" MODIFIED="1389652724418"><richcontent TYPE="NOTE">

<html>
