  <body>
    <p>
      <b>&#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x447;&#x451;&#x440;&#x43d;&#x43e;&#x433;&#x43e; &#x44f;&#x449;&#x438;&#x43a;&#x430; (black box testing)</b>&#xa0; - &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435;, &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x430;&#x43d;&#x43d;&#x43e;&#x435; &#x43d;&#x430; &#x430;&#x43d;&#x430;&#x43b;&#x438;&#x437;&#x435; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x439; &#x438;&#x43b;&#x438; &#x43d;&#x435;&#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x439; &#x441;&#x43f;&#x435;&#x446;&#x438;&#x444;&#x438;&#x43a;&#x430;&#x446;&#x438;&#x438; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b;, &#x43f;&#x440;&#x438; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x430; &#x440;&#x430;&#x441;&#x441;&#x43c;&#x430;&#x442;&#x440;&#x438;&#x432;&#x430;&#x435;&#x442;&#x441;&#x44f; &#x43a;&#x430;&#x43a; &#x43e;&#x431;&#x44a;&#x435;&#x43a;&#x442;, &#x432;&#x43d;&#x443;&#x442;&#x440;&#x435;&#x43d;&#x43d;&#x44f;&#x44f; &#x441;&#x442;&#x440;&#x443;&#x43a;&#x442;&#x443;&#x440;&#x430; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x433;&#x43e; &#x43d;&#x435;&#x438;&#x437;&#x432;&#x435;&#x441;&#x442;&#x43d;&#x430;.
    </p>
    <p>
      
    </p>
    <p>
      <i>&#x412; &#x447;&#x438;&#x441;&#x442;&#x43e;&#x43c; &#x432;&#x438;&#x434;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x447;&#x435;&#x440;&#x43d;&#x43e;&#x433;&#x43e; &#x44f;&#x449;&#x438;&#x43a;&#x430; &#x432; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x41d;&#x41f;&#x41e; &#x41a;&#x43e;&#x43c;&#x43f;&#x44c;&#x44e;&#x442;&#x435;&#x440; &#x432;&#x441;&#x442;&#x440;&#x435;&#x447;&#x430;&#x435;&#x442;&#x441;&#x44f; &#x43a;&#x440;&#x430;&#x439;&#x43d;&#x435; &#x440;&#x435;&#x434;&#x43a;&#x43e;, &#x438; &#x441;&#x432;&#x44f;&#x437;&#x430;&#x43d;&#x43e; &#x44d;&#x442;&#x43e;, &#x43f;&#x440;&#x435;&#x436;&#x434;&#x435; &#x432;&#x441;&#x435;&#x433;&#x43e;, &#x441; &#x43c;&#x430;&#x441;&#x448;&#x442;&#x430;&#x431;&#x43d;&#x43e;&#x441;&#x442;&#x44c;&#x44e; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x443;&#x435;&#x43c;&#x43e;&#x439; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b;, &#x438;&#x43c;&#x435;&#x44e;&#x449;&#x435;&#x439; &#x441;&#x43b;&#x43e;&#x436;&#x43d;&#x443;&#x44e; &#x441;&#x442;&#x440;&#x443;&#x43a;&#x442;&#x443;&#x440;&#x443; &#x438; &#x442;&#x435;&#x441;&#x43d;&#x43e; &#x432;&#x437;&#x430;&#x438;&#x43c;&#x43e;&#x434;&#x435;&#x439;&#x441;&#x442;&#x432;&#x443;&#x44e;&#x449;&#x435;&#x439; &#x441; &#x43e;&#x431;&#x449;&#x435;&#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x43d;&#x44b;&#x43c; &#x41f;&#x41e;.</i>
    </p>
    <p>
      
    </p>
    <p>
      <u>&#x412;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x438;&#x437; &#x440;&#x430;&#x437;&#x43d;&#x44b;&#x445; &#x438;&#x441;&#x442;&#x43e;&#x447;&#x43d;&#x438;&#x43a;&#x43e;&#x432;</u>:
    </p>
    <ol>
      <li>
        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435;, &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x430;&#x43d;&#x43d;&#x43e;&#x435; &#x43d;&#x430; &#x430;&#x43d;&#x430;&#x43b;&#x438;&#x437;&#x435; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x439; &#x438;&#x43b;&#x438; &#x43d;&#x435;&#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x439; &#x441;&#x43f;&#x435;&#x446;&#x438;&#x444;&#x438;&#x43a;&#x430;&#x446;&#x438;&#x438; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; &#x431;&#x435;&#x437; &#x437;&#x43d;&#x430;&#x43d;&#x438;&#x44f; &#x432;&#x43d;&#x443;&#x442;&#x440;&#x435;&#x43d;&#x43d;&#x435;&#x439; &#x441;&#x442;&#x440;&#x443;&#x43a;&#x442;&#x443;&#x440;&#x44b;. (<u>ISTQB</u>)
      </li>
      <li>
        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435;, &#x43f;&#x440;&#x438; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x430; &#x440;&#x430;&#x441;&#x441;&#x43c;&#x430;&#x442;&#x440;&#x438;&#x432;&#x430;&#x435;&#x442;&#x441;&#x44f; &#x43a;&#x430;&#x43a; &#x43e;&#x431;&#x44a;&#x435;&#x43a;&#x442;, &#x432;&#x43d;&#x443;&#x442;&#x440;&#x435;&#x43d;&#x43d;&#x44f;&#x44f; &#x441;&#x442;&#x440;&#x443;&#x43a;&#x442;&#x443;&#x440;&#x430; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x433;&#x43e; &#x43d;&#x435;&#x438;&#x437;&#x432;&#x435;&#x441;&#x442;&#x43d;&#x430;. (<u>&#x41a;&#x430;&#x43d;&#x435;&#x440; &#x438; &#x434;&#x440;.</u>)
      </li>
    </ol>
  </body>
