  <body>
    <p>
      <b>&#x41c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435;/&#x43a;&#x43e;&#x43c;&#x43f;&#x43e;&#x43d;&#x435;&#x43d;&#x442;&#x43d;&#x43e;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; (unit/component testing)</b>&#xa0; - &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43d;&#x430;&#x438;&#x43c;&#x435;&#x43d;&#x44c;&#x448;&#x438;&#x445; &#x44d;&#x43b;&#x435;&#x43c;&#x435;&#x43d;&#x442;&#x43e;&#x432; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x43d;&#x43e;&#x433;&#x43e; &#x43e;&#x431;&#x435;&#x441;&#x43f;&#x435;&#x447;&#x435;&#x43d;&#x438;&#x44f;, &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x43c;&#x43e;&#x433;&#x443;&#x442; &#x431;&#x44b;&#x442;&#x44c; &#x43f;&#x440;&#x43e;&#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x44b; &#x43f;&#x43e;-&#x43e;&#x442;&#x434;&#x435;&#x43b;&#x44c;&#x43d;&#x43e;&#x441;&#x442;&#x438; (&#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x438;, &#x43e;&#x431;&#x44a;&#x435;&#x43a;&#x442;&#x44b;, &#x43a;&#x43b;&#x430;&#x441;&#x441;&#x44b;, &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x438;). &#x417;&#x430;&#x434;&#x430;&#x447;&#x430; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x433;&#x43e; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; - &#x432;&#x44b;&#x44f;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x435; &#x43b;&#x43e;&#x43a;&#x430;&#x43b;&#x438;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x43d;&#x44b;&#x445; &#x432; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x435; &#x43e;&#x448;&#x438;&#x431;&#x43e;&#x43a; &#x440;&#x435;&#x430;&#x43b;&#x438;&#x437;&#x430;&#x446;&#x438;&#x438; &#x430;&#x43b;&#x433;&#x43e;&#x440;&#x438;&#x442;&#x43c;&#x43e;&#x432;, &#x430; &#x442;&#x430;&#x43a;&#x436;&#x435; &#x432; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x435; &#x441;&#x442;&#x435;&#x43f;&#x435;&#x43d;&#x438; &#x433;&#x43e;&#x442;&#x43e;&#x432;&#x43d;&#x43e;&#x441;&#x442;&#x438; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; &#x43a; &#x43f;&#x435;&#x440;&#x435;&#x445;&#x43e;&#x434;&#x443; &#x43d;&#x430; &#x441;&#x43b;&#x435;&#x434;&#x443;&#x44e;&#x449;&#x438;&#x439; &#x443;&#x440;&#x43e;&#x432;&#x435;&#x43d;&#x44c; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x43a;&#x438; &#x438; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;.
    </p>
    <p>
      &#x412; &#x41d;&#x41f;&#x41e; &#x41a;&#x43e;&#x43c;&#x43f;&#x44c;&#x44e;&#x442;&#x435;&#x440; &#x43d;&#x430;&#x434; &#x440;&#x430;&#x437;&#x43b;&#x438;&#x447;&#x43d;&#x44b;&#x43c;&#x438; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x438;&#x43c;&#x44b;&#x43c;&#x438; &#x444;&#x440;&#x430;&#x433;&#x43c;&#x435;&#x43d;&#x442;&#x430;&#x43c;&#x438; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;, &#x441;&#x43e;&#x441;&#x442;&#x430;&#x432;&#x43b;&#x44f;&#x44e;&#x449;&#x438;&#x445; &#x43f;&#x43b;&#x430;&#x442;&#x444;&#x43e;&#x440;&#x43c;&#x443; IS-Builder, &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x432;&#x44b;&#x43f;&#x43e;&#x43b;&#x43d;&#x44f;&#x435;&#x442;&#x441;&#x44f; &#x441;&#x430;&#x43c;&#x438;&#x43c;&#x438; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x447;&#x438;&#x43a;&#x430;&#x43c;&#x438;, &#x43f;&#x440;&#x43e;&#x432;&#x43e;&#x434;&#x438;&#x442;&#x441;&#x44f; &#x43f;&#x43e; &#x43f;&#x440;&#x438;&#x43d;&#x446;&#x438;&#x43f;&#x443; &#xab;&#x431;&#x435;&#x43b;&#x43e;&#x433;&#x43e; &#x44f;&#x449;&#x438;&#x43a;&#x430;&#xbb; &#x438; &#x447;&#x430;&#x441;&#x442;&#x43e; &#x432;&#x43a;&#x43b;&#x44e;&#x447;&#x430;&#x435;&#x442; &#x442;&#x435; &#x438;&#x43b;&#x438; &#x438;&#x43d;&#x44b;&#x435; &#x43c;&#x435;&#x442;&#x43e;&#x434;&#x44b; &#x430;&#x43d;&#x430;&#x43b;&#x438;&#x437;&#x430; &#x43a;&#x43e;&#x434;&#x430;. &#x414;&#x435;&#x444;&#x435;&#x43a;&#x442;&#x44b; &#x43f;&#x440;&#x438; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x438;, &#x43a;&#x430;&#x43a; &#x43f;&#x440;&#x430;&#x432;&#x438;&#x43b;&#x43e;, &#x438;&#x441;&#x43f;&#x440;&#x430;&#x432;&#x43b;&#x44f;&#x44e;&#x442;&#x441;&#x44f; &#x441;&#x440;&#x430;&#x437;&#x443; &#x43f;&#x43e;&#x441;&#x43b;&#x435; &#x43d;&#x430;&#x445;&#x43e;&#x436;&#x434;&#x435;&#x43d;&#x438;&#x44f; &#x431;&#x435;&#x437; &#x441;&#x43e;&#x441;&#x442;&#x430;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x43e;&#x442;&#x447;&#x435;&#x442;&#x430; &#x43e;&#x431; &#x43e;&#x448;&#x438;&#x431;&#x43a;&#x435;. &#x412; &#x431;&#x43e;&#x43b;&#x44c;&#x448;&#x438;&#x43d;&#x441;&#x442;&#x432;&#x435; &#x441;&#x43b;&#x443;&#x447;&#x430;&#x435;&#x432; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x43e;&#x43b;&#x43d;&#x43e;&#x441;&#x442;&#x44c;&#x44e; &#x430;&#x432;&#x442;&#x43e;&#x43c;&#x430;&#x442;&#x438;&#x437;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x43e;. &#x414;&#x43b;&#x44f; &#x43a;&#x43e;&#x43c;&#x43f;&#x43e;&#x43d;&#x435;&#x43d;&#x442; &#x43f;&#x440;&#x438;&#x43a;&#x43b;&#x430;&#x434;&#x43d;&#x43e;&#x439; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x43a;&#x438; &#x438; &#x434;&#x440;&#x443;&#x433;&#x438;&#x445; &#x447;&#x430;&#x441;&#x442;&#x435;&#x439; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; DIRECTUM &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43c;&#x43e;&#x436;&#x435;&#x442; &#x43f;&#x440;&#x43e;&#x432;&#x43e;&#x434;&#x438;&#x442;&#x44c;&#x441;&#x44f; &#x432; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;.
    </p>
    <p>
      
    </p>
    <p>
      <u>&#x412;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x438;&#x437; &#x440;&#x430;&#x437;&#x43d;&#x44b;&#x445; &#x438;&#x441;&#x442;&#x43e;&#x447;&#x43d;&#x438;&#x43a;&#x43e;&#x432;</u>:
    </p>
    <ol>
      <li>
        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43d;&#x430;&#x438;&#x43c;&#x435;&#x43d;&#x44c;&#x448;&#x438;&#x445; &#x44d;&#x43b;&#x435;&#x43c;&#x435;&#x43d;&#x442;&#x43e;&#x432; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x43d;&#x43e;&#x433;&#x43e; &#x43e;&#x431;&#x435;&#x441;&#x43f;&#x435;&#x447;&#x435;&#x43d;&#x438;&#x44f;, &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x43c;&#x43e;&#x433;&#x443;&#x442; &#x431;&#x44b;&#x442;&#x44c; &#x43f;&#x440;&#x43e;&#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x44b; &#x43f;&#x43e;-&#x43e;&#x442;&#x434;&#x435;&#x43b;&#x44c;&#x43d;&#x43e;&#x441;&#x442;&#x438; (&#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x438;, &#x43e;&#x431;&#x44a;&#x435;&#x43a;&#x442;&#x44b;, &#x43a;&#x43b;&#x430;&#x441;&#x441;&#x44b;, &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x438;). (<u>ISTQB</u>)
      </li>
      <li>
        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x44b; &#x43d;&#x430; &#x443;&#x440;&#x43e;&#x432;&#x43d;&#x435; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x44c;&#x43d;&#x43e; &#x432;&#x437;&#x44f;&#x442;&#x44b;&#x445; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x435;&#x439;, &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x439; &#x438;&#x43b;&#x438; &#x43a;&#x43b;&#x430;&#x441;&#x441;&#x43e;&#x432;. &#x426;&#x435;&#x43b;&#x44c; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x433;&#x43e; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x441;&#x43e;&#x441;&#x442;&#x43e;&#x438;&#x442; &#x432; &#x432;&#x44b;&#x44f;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x438; &#x43b;&#x43e;&#x43a;&#x430;&#x43b;&#x438;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x43d;&#x44b;&#x445; &#x432; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x435; &#x43e;&#x448;&#x438;&#x431;&#x43e;&#x43a; &#x432; &#x440;&#x435;&#x430;&#x43b;&#x438;&#x437;&#x430;&#x446;&#x438;&#x438; &#x430;&#x43b;&#x433;&#x43e;&#x440;&#x438;&#x442;&#x43c;&#x43e;&#x432;, &#x430; &#x442;&#x430;&#x43a;&#x436;&#x435; &#x432; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x438; &#x441;&#x442;&#x435;&#x43f;&#x435;&#x43d;&#x438; &#x433;&#x43e;&#x442;&#x43e;&#x432;&#x43d;&#x43e;&#x441;&#x442;&#x438; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; &#x43a; &#x43f;&#x435;&#x440;&#x435;&#x445;&#x43e;&#x434;&#x443; &#x43d;&#x430; &#x441;&#x43b;&#x435;&#x434;&#x443;&#x44e;&#x449;&#x438;&#x439; &#x443;&#x440;&#x43e;&#x432;&#x435;&#x43d;&#x44c; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x43a;&#x438; &#x438; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;. &#x41c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x432;&#x43e;&#x434;&#x438;&#x442;&#x441;&#x44f; &#x43f;&#x43e; &#x43f;&#x440;&#x438;&#x43d;&#x446;&#x438;&#x43f;&#x443; &#xab;&#x431;&#x435;&#x43b;&#x43e;&#x433;&#x43e; &#x44f;&#x449;&#x438;&#x43a;&#x430;&#xbb;, &#x442;&#x43e; &#x435;&#x441;&#x442;&#x44c; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x44b;&#x432;&#x430;&#x435;&#x442;&#x441;&#x44f; &#x43d;&#x430; &#x437;&#x43d;&#x430;&#x43d;&#x438;&#x438; &#x432;&#x43d;&#x443;&#x442;&#x440;&#x435;&#x43d;&#x43d;&#x435;&#x439; &#x441;&#x442;&#x440;&#x443;&#x43a;&#x442;&#x443;&#x440;&#x44b; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x44b;, &#x438; &#x447;&#x430;&#x441;&#x442;&#x43e; &#x432;&#x43a;&#x43b;&#x44e;&#x447;&#x430;&#x435;&#x442; &#x442;&#x435; &#x438;&#x43b;&#x438; &#x438;&#x43d;&#x44b;&#x435; &#x43c;&#x435;&#x442;&#x43e;&#x434;&#x44b; &#x430;&#x43d;&#x430;&#x43b;&#x438;&#x437;&#x430; &#x43f;&#x43e;&#x43a;&#x440;&#x44b;&#x442;&#x438;&#x44f; &#x43a;&#x43e;&#x434;&#x430;. (<u>&#x421;&#x438;&#x43d;&#x438;&#x446;&#x44b;&#x43d; &#x438; &#x434;&#x440;.</u>)
      </li>
      <li>
        &#x41a;&#x43e;&#x43c;&#x43f;&#x43e;&#x43d;&#x435;&#x43d;&#x442;&#x43d;&#x43e;&#x435; (&#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435;) &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x44f;&#x435;&#x442; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x43e;&#x441;&#x442;&#x44c; &#x438; &#x438;&#x449;&#x435;&#x442; &#x434;&#x435;&#x444;&#x435;&#x43a;&#x442;&#x44b; &#x432; &#x447;&#x430;&#x441;&#x442;&#x44f;&#x445; &#x43f;&#x440;&#x438;&#x43b;&#x43e;&#x436;&#x435;&#x43d;&#x438;&#x44f;, &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x434;&#x43e;&#x441;&#x442;&#x443;&#x43f;&#x43d;&#x44b; &#x438; &#x43c;&#x43e;&#x433;&#x443;&#x442; &#x431;&#x44b;&#x442;&#x44c; &#x43f;&#x440;&#x43e;&#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x44b; &#x43f;&#x43e;-&#x43e;&#x442;&#x434;&#x435;&#x43b;&#x44c;&#x43d;&#x43e;&#x441;&#x442;&#x438; (&#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x438; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;, &#x43e;&#x431;&#x44a;&#x435;&#x43a;&#x442;&#x44b;, &#x43a;&#x43b;&#x430;&#x441;&#x441;&#x44b;, &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x438; &#x438; &#x442;.&#x434;.). &#x41e;&#x431;&#x44b;&#x447;&#x43d;&#x43e; &#x43a;&#x43e;&#x43c;&#x43f;&#x43e;&#x43d;&#x435;&#x43d;&#x442;&#x43d;&#x43e;&#x435; (&#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x44c;&#x43d;&#x43e;&#x435;) &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x432;&#x43e;&#x434;&#x438;&#x442;&#x441;&#x44f; &#x43f;&#x43e;&#x441;&#x440;&#x435;&#x434;&#x441;&#x442;&#x432;&#x43e;&#x43c; &#x432;&#x44b;&#x437;&#x43e;&#x432;&#x430; &#x43a;&#x43e;&#x434;&#x430;, &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x439; &#x43d;&#x435;&#x43e;&#x431;&#x445;&#x43e;&#x434;&#x438;&#x43c;&#x43e; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x438;&#x442;&#x44c; &#x438; &#x43f;&#x440;&#x438; &#x43f;&#x43e;&#x434;&#x434;&#x435;&#x440;&#x436;&#x43a;&#x435; &#x441;&#x440;&#x435;&#x434; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x43a;&#x438;. (<u>&#x41f;&#x440;&#x43e; &#x422;&#x435;&#x441;&#x442;&#x438;&#x43d;&#x433;</u>)
      </li>
      <li>
        &#x42d;&#x442;&#x43e;&#x442; &#x443;&#x440;&#x43e;&#x432;&#x435;&#x43d;&#x44c; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43f;&#x43e;&#x437;&#x432;&#x43e;&#x43b;&#x44f;&#x435;&#x442; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x438;&#x442;&#x44c; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x44c;&#x43d;&#x43e; &#x432;&#x437;&#x44f;&#x442;&#x43e;&#x433;&#x43e; &#x44d;&#x43b;&#x435;&#x43c;&#x435;&#x43d;&#x442;&#x430; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b;. &#x427;&#x442;&#x43e; &#x441;&#x447;&#x438;&#x442;&#x430;&#x442;&#x44c; &#x44d;&#x43b;&#x435;&#x43c;&#x435;&#x43d;&#x442;&#x43e;&#x43c; &#x2013; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x435;&#x43c; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x44f;&#x435;&#x442;&#x441;&#x44f; &#x43a;&#x43e;&#x43d;&#x442;&#x435;&#x43a;&#x441;&#x442;&#x43e;&#x43c;. (<u>SWEBOK</u>)
      </li>
    </ol>
