<node TEXT="&#x41d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x439;" ID="ID_325599631" CREATED="1389031613187" MODIFIED="1389699640406"><richcontent TYPE="NOTE">

<html>
  <head>
    
  </head>
  <body>
    <p>
      <b>&#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x439; (requirements-based testing)</b>&#xa0; - &#x43f;&#x43e;&#x434;&#x445;&#x43e;&#x434; &#x43a; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44e;, &#x43f;&#x440;&#x438; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x438; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x430;&#x442;&#x44b;&#x432;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x446;&#x435;&#x43b;&#x435;&#x439; &#x438; &#x443;&#x441;&#x43b;&#x43e;&#x432;&#x438;&#x439; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;, &#x432;&#x44b;&#x442;&#x435;&#x43a;&#x430;&#x44e;&#x449;&#x438;&#x445; &#x438;&#x437; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x439;. &#x422;&#x430;&#x43a; &#x434;&#x43b;&#x44f; &#x43a;&#x430;&#x436;&#x434;&#x43e;&#x433;&#x43e; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43f;&#x438;&#x448;&#x435;&#x442;&#x441;&#x44f; &#x43e;&#x434;&#x438;&#x43d; &#x438;&#x43b;&#x438; &#x43d;&#x435;&#x441;&#x43a;&#x43e;&#x43b;&#x44c;&#x43a;&#x43e; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x445; &#x441;&#x43b;&#x443;&#x447;&#x430;&#x435;&#x432;, &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x44f;&#x44e;&#x449;&#x438;&#x445; &#x432;&#x44b;&#x43f;&#x43e;&#x43b;&#x43d;&#x435;&#x43d;&#x438;&#x435; &#x434;&#x430;&#x43d;&#x43d;&#x43e;&#x433;&#x43e; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;.
    </p>
    <p>
      
    </p>
    <p>
      <i>&#x412; &#x41d;&#x41f;&#x41e; &#x41a;&#x43e;&#x43c;&#x43f;&#x44c;&#x44e;&#x442;&#x435;&#x440; &#x43d;&#x430; &#x434;&#x430;&#x43d;&#x43d;&#x43e;&#x43c; &#x43f;&#x43e;&#x434;&#x445;&#x43e;&#x434;&#x435; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x430;&#x43d;&#x430; &#x43f;&#x440;&#x430;&#x43a;&#x442;&#x438;&#x447;&#x435;&#x441;&#x43a;&#x438; &#x432;&#x441;&#x44f; &#x434;&#x435;&#x44f;&#x442;&#x435;&#x43b;&#x44c;&#x43d;&#x43e;&#x441;&#x442;&#x44c; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x430; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;</i>.
    </p>
    <p>
      
    </p>
    <p>
      <u>&#x412;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x438;&#x437; &#x440;&#x430;&#x437;&#x43d;&#x44b;&#x445; &#x438;&#x441;&#x442;&#x43e;&#x447;&#x43d;&#x438;&#x43a;&#x43e;&#x432;</u>:
    </p>
    <ol>
      <li>
        &#x41f;&#x43e;&#x434;&#x445;&#x43e;&#x434; &#x43a; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44e;, &#x43f;&#x440;&#x438; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x438; &#x440;&#x430;&#x437;&#x440;&#x430;&#x431;&#x430;&#x442;&#x44b;&#x432;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x446;&#x435;&#x43b;&#x435;&#x439; &#x438; &#x443;&#x441;&#x43b;&#x43e;&#x432;&#x438;&#x439; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;, &#x432;&#x44b;&#x442;&#x435;&#x43a;&#x430;&#x44e;&#x449;&#x438;&#x445; &#x438;&#x437; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x439;. (<u>ISTQB</u>)
      </li>
      <li>
        &#x414;&#x43b;&#x44f; &#x43a;&#x430;&#x436;&#x434;&#x43e;&#x433;&#x43e; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43f;&#x438;&#x448;&#x443;&#x442;&#x441;&#x44f; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x43b;&#x443;&#x447;&#x430;&#x438;, &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x44f;&#x44e;&#x449;&#x438;&#x435; &#x432;&#x44b;&#x43f;&#x43e;&#x43b;&#x43d;&#x435;&#x43d;&#x438;&#x435; &#x434;&#x430;&#x43d;&#x43d;&#x43e;&#x433;&#x43e; &#x442;&#x440;&#x435;&#x431;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;. (<u>&#x41f;&#x440;&#x43e; &#x422;&#x435;&#x441;&#x442;&#x438;&#x43d;&#x433;</u>)
      </li>
    </ol>
  </body>
