  <body>
    <p>
      <b>&#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x43e; &#x432;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x430;&#x43c; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; (use case testing)</b>&#xa0; - &#x43f;&#x43e;&#x434;&#x445;&#x43e;&#x434; &#x43a; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44e;, &#x43f;&#x440;&#x438; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x438; &#x441;&#x43e;&#x437;&#x434;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x434;&#x43b;&#x44f; &#x432;&#x44b;&#x43f;&#x43e;&#x43b;&#x43d;&#x435;&#x43d;&#x438;&#x44f; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x435;&#x432; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;, &#x43d;&#x430;&#x43f;&#x438;&#x441;&#x430;&#x43d;&#x43d;&#x44b;&#x445; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x43f;&#x440;&#x435;&#x434;&#x441;&#x442;&#x430;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x43e; &#x441;&#x43f;&#x43e;&#x441;&#x43e;&#x431;&#x430;&#x445; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43f;&#x440;&#x43e;&#x434;&#x443;&#x43a;&#x442;&#x430;.
    </p>
    <p>
      
    </p>
    <p>
      &#x412; &#x41d;&#x41f;&#x41e; &#x41a;&#x43e;&#x43c;&#x43f;&#x44c;&#x44e;&#x442;&#x435;&#x440; &#x434;&#x430;&#x43d;&#x43d;&#x44b;&#x439; &#x43f;&#x43e;&#x434;&#x445;&#x43e;&#x434;, &#x432; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x43d;&#x43e;&#x43c;, &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x443;&#x435;&#x442;&#x441;&#x44f; &#x43f;&#x440;&#x438; &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x438; &#x43f;&#x440;&#x43e;&#x434;&#x443;&#x43a;&#x442;&#x43e;&#x432; &#x43e;&#x442;&#x434;&#x435;&#x43b;&#x430;&#x43c;&#x438; &#x432;&#x43d;&#x435;&#x434;&#x440;&#x435;&#x43d;&#x438;&#x44f;.
    </p>
    <p>
      
    </p>
    <p>
      <u>&#x412;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x438;&#x437; &#x440;&#x430;&#x437;&#x43d;&#x44b;&#x445; &#x438;&#x441;&#x442;&#x43e;&#x447;&#x43d;&#x438;&#x43a;&#x43e;&#x432;</u>:
    </p>
    <ol>
      <li>
        &#x420;&#x430;&#x437;&#x440;&#x430;&#x431;&#x43e;&#x442;&#x43a;&#x430; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432; &#x43c;&#x435;&#x442;&#x43e;&#x434;&#x43e;&#x43c; &#x447;&#x435;&#x440;&#x43d;&#x43e;&#x433;&#x43e; &#x44f;&#x449;&#x438;&#x43a;&#x430;, &#x432; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x43e;&#x432;&#x44b;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x438; &#x441;&#x43e;&#x437;&#x434;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x434;&#x43b;&#x44f; &#x432;&#x44b;&#x43f;&#x43e;&#x43b;&#x43d;&#x435;&#x43d;&#x438;&#x44f; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x435;&#x432; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f;. (<u>ISTQB</u>)
      </li>
      <li>
        &#x41d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x43f;&#x440;&#x435;&#x434;&#x441;&#x442;&#x430;&#x432;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x43e; &#x441;&#x43f;&#x43e;&#x441;&#x43e;&#x431;&#x430;&#x445; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43f;&#x440;&#x43e;&#x434;&#x443;&#x43a;&#x442;&#x430; &#x441;&#x43e;&#x437;&#x434;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x432;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b; (use cases). &#x41f;&#x43e; &#x43a;&#x43e;&#x43d;&#x43a;&#x440;&#x435;&#x442;&#x43d;&#x43e;&#x43c;&#x443; &#x432;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x443; &#x438;&#x441;&#x43f;&#x43e;&#x43b;&#x44c;&#x437;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x44f; &#x43c;&#x43e;&#x436;&#x43d;&#x43e; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x438;&#x442;&#x44c; &#x43e;&#x434;&#x438;&#x43d; &#x438;&#x43b;&#x438; &#x431;&#x43e;&#x43b;&#x435;&#x435; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x435;&#x432;. &#x41d;&#x430; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x43a;&#x443; &#x43a;&#x430;&#x436;&#x434;&#x43e;&#x433;&#x43e; &#x441;&#x446;&#x435;&#x43d;&#x430;&#x440;&#x438;&#x44f; &#x43f;&#x438;&#x448;&#x443;&#x442;&#x441;&#x44f; &#x442;&#x435;&#x441;&#x442;&#x44b;, &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x434;&#x43e;&#x43b;&#x436;&#x43d;&#x44b; &#x431;&#x44b;&#x442;&#x44c; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x435;&#x43d;&#x44b;. (<u>&#x41f;&#x440;&#x43e; &#x422;&#x435;&#x441;&#x442;&#x438;&#x43d;&#x433;</u>)
      </li>
    </ol>
  </body>
</html>
</richcontent>
