<node TEXT="&#x41d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x43c;&#x43e;&#x434;&#x435;&#x43b;&#x438;" ID="ID_280664844" CREATED="1389031634365" MODIFIED="1389699914779"><richcontent TYPE="NOTE">

<html>
  <head>
    
  </head>
  <body>
    <p>
      <b>&#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x43c;&#x43e;&#x434;&#x435;&#x43b;&#x438; (model-based testing)</b>&#xa0; - &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x43d;&#x43e;&#x433;&#x43e; &#x43e;&#x431;&#x435;&#x441;&#x43f;&#x435;&#x447;&#x435;&#x43d;&#x438;&#x44f;, &#x432; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x44b; &#x447;&#x430;&#x441;&#x442;&#x438;&#x447;&#x43d;&#x43e; &#x438;&#x43b;&#x438; &#x43f;&#x43e;&#x43b;&#x43d;&#x43e;&#x441;&#x442;&#x44c;&#x44e; &#x43f;&#x43e;&#x43b;&#x443;&#x447;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x438;&#x437; &#x43c;&#x43e;&#x434;&#x435;&#x43b;&#x438;, &#x43e;&#x43f;&#x438;&#x441;&#x44b;&#x432;&#x430;&#x44e;&#x449;&#x435;&#x439; &#x43d;&#x435;&#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x430;&#x441;&#x43f;&#x435;&#x43a;&#x442;&#x44b; (&#x447;&#x430;&#x449;&#x435; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x44b;&#x435;) &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x443;&#x435;&#x43c;&#x43e;&#x439; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b;.
    </p>
    <p>
      &#x41f;&#x440;&#x438;&#x43c;&#x435;&#x440;&#x44b;:
    </p>
    <ol>
      <li>
        &#x421;&#x442;&#x430;&#x43d;&#x434;&#x430;&#x440;&#x442;&#x43d;&#x44b;&#x435; &#x43f;&#x440;&#x43e;&#x432;&#x435;&#x440;&#x43a;&#x438; &#x438;&#x43d;&#x441;&#x442;&#x430;&#x43b;&#x43b;&#x44f;&#x442;&#x43e;&#x440;&#x43e;&#x432; - &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43c;&#x430;&#x441;&#x442;&#x435;&#x440;&#x43e;&#x432; &#x443;&#x441;&#x442;&#x430;&#x43d;&#x43e;&#x432;&#x43a;&#x438; &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x434;&#x438;&#x430;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x44b; &#x441;&#x43e;&#x441;&#x442;&#x43e;&#x44f;&#x43d;&#x438;&#x439; &#x438; &#x43f;&#x435;&#x440;&#x435;&#x445;&#x43e;&#x434;&#x43e;&#x432; &#x434;&#x43b;&#x44f; &#x438;&#x43d;&#x441;&#x442;&#x430;&#x43b;&#x43b;&#x44f;&#x442;&#x43e;&#x440;&#x43e;&#x432;.
      </li>
      <li>
        Conterra 2.0. &#x41f;&#x427;. &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; - &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x440;&#x430;&#x431;&#x43e;&#x442;&#x44b; &#x441; &#x43c;&#x43e;&#x434;&#x443;&#x43b;&#x435;&#x43c; Record Management &#x43d;&#x430; &#x43e;&#x441;&#x43d;&#x43e;&#x432;&#x435; &#x441;&#x445;&#x435;&#x43c;&#x44b; &#x43f;&#x435;&#x440;&#x435;&#x445;&#x43e;&#x434;&#x43e;&#x432; &#x43f;&#x43e; &#x441;&#x442;&#x430;&#x434;&#x438;&#x44f;&#x43c; &#x416;&#x426; &#x437;&#x430;&#x43f;&#x438;&#x441;&#x438;.
      </li>
    </ol>
    <p>
      
    </p>
    <p>
      <u>&#x412;&#x430;&#x440;&#x438;&#x430;&#x43d;&#x442;&#x44b; &#x43e;&#x43f;&#x440;&#x435;&#x434;&#x435;&#x43b;&#x435;&#x43d;&#x438;&#x44f; &#x438;&#x437; &#x440;&#x430;&#x437;&#x43d;&#x44b;&#x445; &#x438;&#x441;&#x442;&#x43e;&#x447;&#x43d;&#x438;&#x43a;&#x43e;&#x432;</u>:
    </p>
    <ol>
      <li>
        &#x422;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435; &#x43f;&#x440;&#x43e;&#x433;&#x440;&#x430;&#x43c;&#x43c;&#x43d;&#x43e;&#x433;&#x43e; &#x43e;&#x431;&#x435;&#x441;&#x43f;&#x435;&#x447;&#x435;&#x43d;&#x438;&#x44f;, &#x432; &#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x43e;&#x43c; &#x442;&#x435;&#x441;&#x442;&#x44b; &#x447;&#x430;&#x441;&#x442;&#x438;&#x447;&#x43d;&#x43e; &#x438;&#x43b;&#x438; &#x43f;&#x43e;&#x43b;&#x43d;&#x43e;&#x441;&#x442;&#x44c;&#x44e; &#x43f;&#x43e;&#x43b;&#x443;&#x447;&#x430;&#x44e;&#x442;&#x441;&#x44f; &#x438;&#x437; &#x43c;&#x43e;&#x434;&#x435;&#x43b;&#x438;, &#x43e;&#x43f;&#x438;&#x441;&#x44b;&#x432;&#x430;&#x44e;&#x449;&#x435;&#x439; &#x43d;&#x435;&#x43a;&#x43e;&#x442;&#x43e;&#x440;&#x44b;&#x435; &#x430;&#x441;&#x43f;&#x435;&#x43a;&#x442;&#x44b; (&#x447;&#x430;&#x449;&#x435; &#x444;&#x443;&#x43d;&#x43a;&#x446;&#x438;&#x43e;&#x43d;&#x430;&#x43b;&#x44c;&#x43d;&#x44b;&#x435;) &#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x443;&#x435;&#x43c;&#x43e;&#x439; &#x441;&#x438;&#x441;&#x442;&#x435;&#x43c;&#x44b;.
      </li>
    </ol>
  </body>
</html>
