<node TEXT="&#x411;&#x435;&#x442;&#x430;-&#x442;&#x435;&#x441;&#x442;&#x438;&#x440;&#x43e;&#x432;&#x430;&#x43d;&#x438;&#x435;" ID="ID_317729969" CREATED="1389031663031" MODIFIED="1389698612669"><richcontent TYPE="NOTE">

<html>
  <head>
    
